★ロゴスのメッセンジャーバッグ！<br>
<br>
●水に強いスプラッシュシリーズ！秘密は防水生地と無縫製構造<br>
●PVCではなくTPUの無縫製構造だから、非常に軽量です<br>
●背中できっちり固定できるメッセンジャータイプ<br>
<br>
■素材：TPU<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
<BR>
■サイズ：（約）幅36.5×奥行12.5×高さ24cm<br>
■総重量：（約）650g<br><br>
